import './App.css';

const headers = [
  { text: '이수', value: 'subTitle'},
  { text: '필수', value: 'manANDchoice' },
  { text: '과목명', value: 'subName'},
  { text: '학점', value: 'credit'},
  { text: '출석점수', value: 'attScore'},
  { text: '과제점수', value: 'assScore'},
  { text: '중간고사', value: 'midterm'},
  { text: '기말고사', value: 'final'},
  { text: '총점', value: 'sumScore'},
  { text: '평균', value: 'avg'},
  { text: '성적', value: 'grade'}
];

function App() {
  return (
    <div className="App">
    </div>
  );
}

export default App;
